        table.logo {
            width: 1920px;
            height: 40px;
            background-color: #FFFFFF;
            margin-left: auto;
            margin-right: auto;
        }
        table.logo th {
            text-align: left;
            padding: 9px 0 1px 24px;
        }

        div.container {
            width: 1160px;
            background-color: #FFFFFF;
            margin-top: 10px;
            margin-right: auto;
            margin-left: auto;
            padding: 30px 20px 30px 20px;
        }

        table.exec-info {
            width: 100%;
            background-color: #FFFFFF;
            padding: 0 0 5px 0;
        }
        table.exec-info th {
            font-family: PingFangSC-Semibold, sans-serif;
            color: #293040;
            font-size: 20px;
            height: 26px;
            text-align: left;
            padding: 0 0 20px 0;
            word-break: break-all;
        }
        table.exec-info td.normal {
            color: #5E6678;
            font-size: 14px;
            height: 20px;
            text-align: left;
            padding: 0 0 15px 0;
            word-break: break-all;
        }
        table.exec-info td.first {
            font-family: PingFangSC-Regular, sans-serif;
            width: 156px;
        }
        table.exec-info td.second {
            font-family: PingFangSC-Medium, sans-serif;
            width: 424px;
        }
        table.exec-info td.third {
            font-family: PingFangSC-Regular, sans-serif;
            width: 152px;
        }
        table.exec-info td.fourth {
            font-family: PingFangSC-Medium, sans-serif;
            width: 428px;
        }

        table.summary {
            width: 1160px;
            height: 89px;
            margin-left: auto;
            margin-right: auto;
            background-color: #F9FAFC;
        }
        .color-normal {
            color: #293040;
        }
        .color-passed {
            color: #3DCCA6;
        }
        .color-failed {
            color: #F95F5B;
        }
        .color-blocked {
            color: #FFB400;
        }
        .color-ignored {
            color: #8C8C8C;
        }
        .color-unavailable {
            color: #8C8C8C;
        }
        table.summary th.normal {
            font-family: PingFangSC-Semibold, sans-serif;
            font-size: 24px;
            height: 24px;
            width: 110px;
            text-align: center;
            word-break: break-all;
        }
        table.summary td.normal {
            font-family: PingFangSC-Regular, sans-serif;
            color: #5E6678;
            font-size: 14px;
            height: 20px;
            width: 110px;
            text-align: center;
        }
        table.summary th.modules {
            padding: 20px 35px 0 34px;
        }
        table.summary th.modules-done, table.summary th.total-tests, table.summary th.passed {
            padding: 20px 35px 0 0;
        }
        table.summary th.failed, table.summary th.blocked, table.summary th.ignored {
            padding: 20px 35px 0 0;
        }
        table.summary th.unavailable {
            padding: 20px 34px 0 0;
        }
        table.summary td.modules {
            padding: 5px 35px 20px 34px;
        }
        table.summary td.modules-done, table.summary td.total-tests, table.summary td.passed {
            padding: 5px 35px 20px 0;
        }
        table.summary td.failed, table.summary td.blocked, table.summary td.ignored {
            padding: 5px 35px 20px 0;
        }
        table.summary td.unavailable {
            padding: 5px 34px 20px 0;
        }

        table.suites {
            width: 1160px;
            margin-left: auto;
            margin-right: auto;
            margin-top: 30px;
        }
        table.suites th.title {
            font-family: PingFangSC-Semibold, sans-serif;
            color: #293040;
            font-size: 16px;
            height: 22px;
            text-align: left;
        }
        table.suites th.normal {
            font-family: Roboto-Medium, sans-serif;
            color: #293040;
            font-size: 12px;
            height: 36px;
            border-bottom: 1px #E8F0FD solid;
            text-align: left;
        }
        table.suites th.module {
            width: 138px;
            padding: 10px 0 0 20px;
        }
        table.suites th.test-suite {
            width: 384px;
            padding: 10px 0 0 0;
        }
        table.suites th.total {
            width: 110px;
            padding: 10px 0 0 0;
        }
        table.suites th.passed, table.suites th.failed, table.suites th.blocked {
            width: 90px;
            padding: 10px 0 0 0;
        }
        table.suites th.ignored, table.suites th.time {
            width: 90px;
            padding: 10px 0 0 0;
        }
        table.suites th.operate {
            width: 58px;
            padding: 10px 0 0 0;
        }
        table.suites tr.background-color{
            background-color: #F9FAFC;
        }
        table.suites td.normal {
            font-family: Roboto-Regular, sans-serif;
            color: #293040;
            font-size: 14px;
            height: 36px;
            text-align: left;
            word-break: break-all;
        }
        table.suites td.module {
            width: 138px;
            padding: 0 0 0 20px;
        }
        table.suites td.test-suite {
            width: 384px;
            padding: 0 0 0 0;
        }
        table.suites td.total {
            width: 110px;
            padding: 0 0 0 0;
        }
        table.suites td.passed, table.suites td.failed, table.suites td.blocked {
            width: 90px;
            padding: 0 0 0 0;
        }
        table.suites td.ignored, table.suites td.time {
            width: 90px;
            padding: 0 0 0 0;
        }
        table.suites td.operate {
            width: 58px;
            padding: 0 0 0 0;
        }

        table.test-suite, table.failure-test {
            width: 1160px;
            margin-left: auto;
            margin-right: auto;
            margin-top: 30px;
        }
        table.test-suite th.title, table.failure-test th.title {
            font-family: PingFangSC-Semibold, sans-serif;
            color: #293040;
            font-size: 14px;
            height: 22px;
            text-align: left;
            wrap-option: no;
            overflow: hidden;
        }
        table.test-suite th.normal, table.failure-test th.normal {
            font-family: Roboto-Medium, sans-serif;
            color: #293040;
            font-size: 12px;
            height: 36px;
            border-bottom: 1px #E8F0FD solid;
            text-align: left;
        }
        table.test-suite th.module {
            width: 138px;
            padding: 5px 0 0 20px;
        }
        table.test-suite th.test-suite {
            width: 384px;
            padding: 5px 0 0 0;
        }
        table.test-suite th.test {
            width: 427px;
            padding: 5px 0 0 0;
        }
        table.test-suite th.time {
            width: 90px;
            padding: 5px 0 0 0;
        }
        table.test-suite th.status {
            width: 11px;
            padding: 5px 0 0 0;
        }
        table.test-suite th.result {
            width: 90px;
            padding: 5px 0 0 0;
        }
        .circle-normal {
            border-radius: 50%;
            width: 6px;
            height: 6px;
            margin: 0;
            padding: 0;
        }
        .circle-white {
            background-color: #FFFFFF;
        }
        .circle-passed {
            background-color: #3DCCA6;
        }
        .circle-failed {
            background-color: #F95F5B;
        }
        .circle-blocked {
            background-color: #FFB400;
        }
        .circle-ignored {
            background-color: #8C8C8C;
        }
        .circle-unavailable {
            background-color: #8C8C8C;
        }
        table.test-suite tr.background-color, table.failure-test tr.background-color {
            background-color: #F9FAFC;
        }
        table.test-suite td.normal, table.failure-test td.normal {
            font-family: Roboto-Regular, sans-serif;
            color: #293040;
            font-size: 14px;
            height: 36px;
            text-align: left;
            word-break: break-all;
        }
        table.test-suite td.module {
            width: 138px;
            padding: 0 0 0 20px;
        }
        table.test-suite td.test-suite {
            width: 384px;
            padding: 0 0 0 0;
        }
        table.test-suite td.test {
            width: 427px;
            padding: 0 0 0 0;
        }
        table.test-suite td.time {
            width: 90px;
            padding: 0 0 0 0;
        }
        table.test-suite td.status {
            width: 11px;
            padding: 0 0 0 0;
        }
        table.test-suite td.result {
            width: 90px;
            padding: 0 0 0 0;
        }

        table.failure-test th.test {
            width: 569px;
            padding: 5px 0 0 20px;
        }
        table.failure-test th.status {
            width: 11px;
            padding: 5px 0 0 0;
        }
        table.failure-test th.result {
            width: 80px;
            padding: 5px 0 0 0;
        }
        table.failure-test th.details {
            width: 480px;
            padding: 5px 0 0 0;
        }

        table.failure-test td.test {
            width: 569px;
            padding: 0 0 0 20px;
        }
        table.failure-test td.status {
            width: 11px;

        table.failure-test td.result {

        table.failure-test td.details {

        div.hidden {
		    overflow: hidden;
			white-space: nowrap;

			width: 424px;
		}

            <td class="normal second"><!--{exec_info.test_time}--></td>
